import Expenses from "./components/Expenses/Expenses";

const App = () => {
  const expense = [
    {
      id: "e1",
      title: "Spray Car",
      amount: 57,
      date: new Date(),
    },
    {
      id: "e2",
      title: "New TV",
      amount: 799.49,
      date: new Date(2021, 2, 12),
    },

    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2020, 6, 30),
    },

    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: 450,
      date: new Date(2023, 10, 20),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenses items={expense} />
    </div>
  );
};

export default App;
